(1817, 0, '', 1, 'AutoUncles aims to make the used car market fair by creating transparency by using data from the Danish Transport and Construction Agency Traffic Authority and survey reports, and then correlate these with data from the Register of Mortgages concerning debt outstanding cars. It gives the opportunity to tell how the car has performed so far. The data is then compared with the data stored on the car ad, and thus it is possible to find out how reliable data in the ad is, and on this basis provide consumers with a better basis for buying a used car..', 0, '', 0, '', 0, '', 2277),
