(1820, 0, '', 0, '', 0, '', 1, 'Sunmapper is a web application that calculates the potential for solar cells on the roof, and gives homeowners an overview of the economy in solar cells. It uses data from the Danish Geodata Agency, and electricity price scenarios from the Danish Energy Agency.  Based on a detailed 3D model of Denmark, Sunmapper calculates how much sun affects the different parts of the rooftop in during the year.  It calculates the most suitable solar cell to places on the roof, so that it produces as much power as possible, as well as the price of the facility, the repayment period, and how much less CO2 it will emit with a photovoltaic system. ', 0, '', 2280),
