(1948, 1, 'Nepal in Data promotes the use of data to inform evidence-based policy and decision making in Nepal', 0, '', 1, 'Nepal in Data visualizes data  and statistics in interesting and engaging ways to enhance data literacy in Nepal. The initiative conducts training for government officials, civil society organizations, educational institutions and students, and journalists on data collection, management, analysis and visualization.', 1, 'Nepal in Data supports organizations who are seeking to advise on data, data collection, management, analysis, visualization and dissemination for their product or services.', 1, 'Nepal in Data uses data for its own research as well as helps researchers who are looking for data', 4157),
