(1958, 0, '', 0, '', 0, '', 1, 'GBIF.org is the primary product of this international collaboration between governments and organizations, and its global index of species occurrence data shares the best-available evidence about where life has and does occur on earth. Now nearing the 1 billion record mark, GBIF.org is a robust, scalable, near real-time platform serving big data for biodiversity. ', 0, '', 4446),
