(1054, 'Y9mcRE2wWq', 40, 'Housing, construction & real estate', '', 0, 0, 'MapYourProperty (MYP) is an all-in-one property mapping and analytic software for the land development and the real estate industry. Our product provides an automated and streamlines way to obtain key development and land use-planning information on a property level. Our SaaS platform helps real estate developers and planners simplify the archaic process of pulling a variety of regulatory and planning information together from government sources. Our simple and intuitive product can save developers time and money when investing development areas. Traditionally, planning and development analysis requires hiring professional experts and usually take 3 â€“ 5 days per property while our application can conduct similar assessment of a property in a matter of minutes using our interactive platform.\r\n\r\nProperty and planning data need to be release by more city in Canada. Data like cemeteries or baby names as open data does not provide any economic or innovation value for startup companies.', 'Streamlining real estate and land development planning with open data analytic. Zillow for real estate developers and consultants', '', 'Real estate, commerical real estate, environm', 'MapYourProperty', '1 to 10', 'submitted survey', 'survey', 'publish', 2015, 'For-profit', '', 'http://www.mapyourproperty.com', 2014, '2015-05-29 00:00:00', '2016-10-06 19:44:17', '', 55, NULL),
