(1696, 'Putww4xBgj', 240, 'IT and geospatial', '', 0, 0, 'It would be significantly helpful if amendments and bills were broken down categorically into what their chief cause or effect will be. For example, we use data from GovTrack.us to analyze each candidate''s legislative record, however, we must first analyze the legislation to categorize what its intended impact is.\r\n\r\nAdditionally, more data at the local level would be supremely helpful. The more local we go, the less data that is available. More information on money in local politics, as well as legislative records, would allow us to better inform voters in local elections, where voter turnout is suffering most.', 'Voter is an app that leverages big data to match people to the political candidates that support their views - Essentially, it''s matchmaking for politics.', '', '', 'Voter', '1 to 10', 'submitted survey', 'survey', 'publish', 2015, 'For-profit', '', 'http://voterapp.us', 2014, '2015-05-26 00:00:00', '2016-10-06 19:44:19', '', 123, NULL),
