(2654, NULL, NULL, 'Other', 'All sectors', NULL, NULL, 'The Puerto Rico Institute of Statistics is the coordinator, custodian and provider of governmental data from other Puerto Rico public agencies and continuously monitors the quality of such data. It also makes public its own complementary independent statistical research about Puerto Rico. It’s limited in these tasks by the funding appropriated to it, but nevertheless has had numerous achievements.', 'The Institute is an autonomous entity of the Government of the Commonwealth of Puerto Rico with authority over the statistical policy of Puerto Rico agencies. It was created for the purpose of promoting changes to Puerto Rico’s statistical and data gathering systems so as to ensure universal and timely access to comprehensive and reliable statistics on Puerto Rico and to conduct its own research.', 'Other', 'The Puerto Rico Institute of Statistics provides access to governmental data and conducts its own statistical research on fundamental issues for Puerto Rico.', 'Puerto Rico Institute of Statistics - Instituto de Estadísticas de Puerto Rico', '11 to 50', 'submitted survey', 'survey', 'dnd', 2017, 'Other', 'Independent government agency', 'http://estadisticas.pr/', 2003, '2017-01-25 11:54:33', '2017-01-30 15:31:35', NULL, 599, '1'),
