(4157, NULL, 157, 'IT and geospatial', 'Social Innovation', 0, NULL, '', 'Bikas Udhyami/Nepal in Data through its development data portal/initiative contributes to the increased availability and accessibility of data and statistics and enhanced data literacy in Nepal. The portal provides access to over 2200 official government data on various sections of society. Users can compare different indicators and visualize and download data. Other features include an interactive timeline, a data calendar, infographics, news and resources.', 'Other', 'Making official government data openly available and accessible for everyone and enhancing data literacy in Nepal.', 'Bikas Udhyami: Nepal in Data', '11 to 50', 'research', 'survey-edit', 'publish', 2015, 'Nonprofit', '', 'http://www.nepalindata.com', 2016, '2017-12-05 11:50:20', '2017-12-05 16:50:20', '', 616, ''),
